       doc.setTextColor(0);
      var font = '';
      doc.addFileToVFS("src/assets/fonts/Pyidaungsu-1.8_Regular-normal.ttf", font);
      doc.addFont("src/assets/fonts/Pyidaungsu-1.8_Regular-normal.ttf", "Pyidaungsu-1.8_Regular", "normal");
      doc.text(this.reportName, 40, 20);
      doc.setFontSize(10);
